var danta = {
    Base: {
        get_param: function (key) {
            if(key in this) {
                return this[key];
            }
            else {
                if(this.element) { // has a jQuery object associated
                    return this.element.data(key);
                }
                
                return null;
            }
        }
    },
    
    adt: { /* abstract data type */
        List: {
            _list: null,
            _get: function () {
                if(this._list === null) {
                    this._list = [];
                }
                
                return this._list;
            },
            
            is_empty: function () {
                return this._get().length <= 0;
            },
            
            /* prepend: function () {}, */
            
            append: function (item, times) {
                if(arguments.length >=2 ) {
                    for(var i = 0; i < times; i++) {
                        this._get().push(item);
                    }
                }
                else {
                    this._get().push(item);
                }
            },
            
            concat: function (arr) {
                this._get();
                this._list = this._list.concat(arr);
            },
            
            /*
            head: function () {
                return this._get()[0];
            },
            */
            /* 
             * an operation for referring to the list consisting of all the components 
             * of a list except for its first (this is called the "tail" of the list.)
             * 
             * tail: function () {},
             */
            
            size: function () {
                return this._get().length;
            },
            
            get: function (i) {
                if(arguments.length == 1) {
                    return this._get()[i];
                }
                
                return this._get();
            },
            
            set: function (i, item) {
                var list = this._get();
                list[i] = item;
            },
            
            empty: function () {
                delete this._list;
                this._list = [];
            },
            
            has: function (item) {
                var has = false;
                
                this._list.forEach(function (e, i, a) {
                    var o1 = JSON.stringify(e);
                    var o2 = JSON.stringify(item);
                    
                    //console.log(o1, o2, o1 === o2);
                    
                    if(o1 === o2) {
                        has = true;
                    }
                });
                
                return has;
            }
        }
    },
    
    Math: {
        get_random_int: function (min, max) {
            return Math.floor(Math.random() * (max - min + 1)) + min;
        }
    },
    
    Array: {
        // http://stackoverflow.com/a/10142256
        shuffle: function () {
            for(
                var j, x, i = this.length; i;
                
                j = Math.floor(Math.random() * i), 
                x = this[--i], this[i] = this[j], this[j] = x
            );

            return this;
        }
    },
    
    $: {
        attach: function (data) {
            console.log("attaching... ", data);
        }
    },
    
    init_helpers: function () {
        //Array.prototype.shuffle = danta.Array.shuffle;
        //Array.prototype = $.extend(Array.prototype, danta.Array);
        
        $.extend(Array.prototype, danta.Array);
        $.extend(Math, danta.Math);
        //$.fn.extend(danta.$);
    },
    
    app: function (app) {
        this.init_helpers();
        
        $(document).ready(function () {
            var fn = function () {} // TODO: make $w() create widgets and $w.x reference them
            
            // autoloading ui/widgets
            var ui = danta.ui._autoload();
            
            var _app = new app(danta, ui.widgets);
            danta.caller = _app;
            
            _app.init();
        });
    }
}
danta.config = {
    REMOTE_BASE_PATH: ""
}
danta.remote = {
    get_end_point: function () {
        return danta.config.REMOTE_BASE_PATH;
    },
    
    call: function (fn, params, done) {
        params["fn"] = fn;
        $.post(danta.config.REMOTE_BASE_PATH, params, done, "json");
    }
    
    /*
    get2: function (path, done) {
        $.get(danta.config.REMOTE_BASE_PATH + path, {}, function (response) {
            console.log("RESPONSE!");
            done(response);
        });
    },
    
    get_regex: function (url, regex, done) {
        $.getJSON(danta.remote.get_end_point(), 
        {fn: "get_regex", params: {url: url, regex: regex}}, function (response) {
            done(response);
        });
    }
    */
}
danta.ui = {
    
    /* ********************************************************************** */
    /* ********************************************************************** */
    /* base ui objects ****************************************************** */
    
    _Widget: {
        _behave: null,
        _behaviors: {},
        
        _attach_behaviors: function () {
            this._behave = this._behave || [];
            
            this._behave.forEach(function (e, i, a) {
                var behavior = danta.ui.behavior[e.behavior];
                behavior(this, e.params);
            }, this);
        },
        
        behave: function (behavior, params) {
            this._behave = this._behave || [];
            if(typeof params === "undefined") {
                params = {};
            }
            
            if(this._behaviors[behavior]) {
                this._behave.push({ behavior: behavior, params: params });
            }
            else {
                throw this.id + " cannot behave " + behavior;
            }
        },
        
        render: function () {
            var dl = $("<dl />").addClass("default");
            
            for(var i in this) {
                if(this.hasOwnProperty(i) && typeof this[i] !== "function") {
                    dl.append("<dt>" + i + "</dt>");
                    dl.append("<dd>" + this[i] + "</dd>");
                }
            }
            
            this.element.append(dl);
        },
        
        hide: function () { this.element.hide(); },
        show: function () { this.element.show(); }
    },
    
    /* user ui objects ****************************************************** */
    
    /* widget objects/functions ********************************************* */
    
    widget: {
        View: {
            _family: ["Base", "ui._Widget"],
            _behaviors: {
                Progressable: function () { return {}; }
            },
            _data: null,
            
            load: function (data) {
                this._data = data;
                this.render();
            },
            
            hide: function (only_container) { 
                var e = only_container ? $(".container", this.element) : this.element;
                e.hide();
            },
            show: function (only_container) { 
                var e = only_container ? $(".container", this.element) : this.element;
                e.show();
            },
            
            render: function () {
                var e = this.element;
                if(this._data) {
                    for(var i in this._data) {
                        $("#" + i, e).text(this._data[i]);
                    }
                }
                
                this._attach_behaviors();
            }
        },
        
        Textbox: {
            _family: ["Base", "ui._Widget"],
            _behaviors: {
                Typeable: function (w) {
                    return {
                        collection: $("input", w.element)
                    };
                },
                Progressable: function () {
                    return {};
                }
            },
            
            value: function () {
                return $("input", this.element).val();
            },
            
            render: function () {
                var label = this.get_param("label") || "";
                var textbox = $('<input type="text" />').addClass("form-control");
                textbox.attr("placeholder", label);
                
                this.element.empty();
                this.element.append(textbox);
                this._attach_behaviors();
            }
        },
        
        Alert: {
            _family: ["Base", "ui._Widget"],
            _message: "",
            _type: "",
            
            display: function (message, type) {
                this._message = message || "";
                this._type = type || "info";
                
                this.render();
            },
            
            render: function () {
                this.element.empty();
                
                var msg = $("<div />").addClass("alert alert-" + this._type).text(this._message);
                this.element.append(msg);
                this.show();
            }
        },
        
        Button: {
            _family: ["Base", "ui._Widget"],
            
            click: function () {},
            
            render: function () {
                var label = this.get_param("label") || "button";
                var button = $("<button />").addClass("btn btn-default").text(label);
                
                button.click(this.click);
                
                this.element.empty();
                this.element.append(button);
                this._attach_behaviors();
            }
        },
        
        Buttons: {
            _family: ["Base", "ui._Widget"],
            
            actions: {},
            
            render: function () {
                var o = this;
                
                o.element.addClass("btn-group");
                
                $("#" + o.id).find("button").each(function () {
                    $(this).addClass("btn btn-default");
                    
                    var id = $(this).text().replace(" ", "_");
                    if(typeof o.actions[id] === "function") {
                        $(this).click(o.actions[id]);
                    }
                });
                
                //this._attach_behaviors();
            }
        },
        
        List: {
            _family: ["Base", "adt.List", "ui._Widget"],
            _behaviors: {
                Clickable: function (w) {
                    return {
                        collection: $("ul > li", w.element)
                    };
                },
                Selectable: function (w) {
                    w.selected_index = -1;
                    w.get_selected = function () { return null; };
                    
                    return {
                        collection: $("ul > li", w.element),
                        action: function (params) {
                            if(params.multiple) {}
                            else {
                                var index = $("ul > li.behavior_Selectable_selected", w.element).index();
                                w.selected_index = index;
                                w.get_selected = function () {
                                    return w._list[w.selected_index];
                                }
                            }
                        }
                    };
                }
            },
            
            render: function () {
                if(!this.is_empty()) {
                    var ul = $("<ul />").addClass("list-unstyled list-group");
                    
                    this._list.forEach(function (e, i, a) {
                        var view = null;
                        
                        switch(typeof e) {
                            case "object":
                                if(typeof e.get_view === "undefined") {
                                    view = e.text !== "" ? e.text : e;
                                }
                                else {
                                    view = e.get_view();
                                }
                                break;
                            default:
                                view = e;
                                break;
                        }
                        ul.append($("<li />").addClass("list-group-item").append(view));
                    });
                    
                    this.element.empty();
                    this.element.append(ul);
                    this._attach_behaviors();
                }
            }
        },
        
        _make: function (jo, type) { /* TODO: how can setters and getter be preserved */
            var pool = {}; var original = null;
            var eo = eval("danta." + type);
            
            if(typeof eo === "undefined") {
                original = danta.ui.widget[type];
            }
            else { original = eo; }
            
            if(typeof original === "undefined") { return {}; }
            
            var o = {}; $.extend(o, original);
            
            if("_family" in o) {
                o._family.forEach(function (e, i, a) {
                    var member = danta.ui.widget._make(null, e);
                    $.extend(pool, member);
                });
                
                delete o._family;
            }
            
            var o = $.extend(pool, o);
            
            if(jo !== null) {
                jo.addClass("widget");
                o.element = jo;
            }
            
            return o;
        }
    },
    
    /* ui functions ********************************************************* */
    
    _make_widget: function (id) {
        var jo = $("#" + id);
        var o = {};
        
        if(jo.length > 0) {
            var data = jo[0].dataset;
            
            if(data.widget) {
                if(typeof danta.ui.widget[data.widget] === "object") {
                    return danta.ui.widget._make(jo, data.widget);
                }
            }
        }
        
        throw "danta.ui.widget._make: error";
    },
    
    _autoload: function () { /* Using Bootstrap for default layout */
        var container = null;
        var row = null;
        
        // @TODO: how should the header and footer be styled?
        
        if(!$("body").hasClass("no_autoload")) {
            container = $("<div />").addClass("container-fluid");
            
            row = $('<div class="row"></div>');
            
            //$("header").addClass("page-header");
            $("header").addClass("col-xs-12 col-sm-12 col-md-12 col-lg-12");
            
            row.append($("header").detach());
            container.append(row);
            
            row = $('<div class="row"></div>');
            $("section").each(function (i, card) {
                if(!$(card).hasClass("no_autoload")) {
                    i+=1;
                    /*
                     * Default stacking of cards:
                     *      mobile: one
                     *      tablet: two
                     *      desktop: four
                     */
                    $(card).addClass("jumbotron col-xs-12 col-sm-6 col-md-6 col-lg-3");

                    if(i%2 == 0) { $(card).addClass("m2"); }
                    if(i%4 == 0) { $(card).addClass("m4"); }
                }
            });
            row.append($("section").detach());
            container.append(row);
            
            row = $('<div class="row"></div>');
            
            $("footer").addClass("col-xs-12 col-sm-12 col-md-12 col-lg-12");
            
            row.append($("footer").detach());
            container.append(row);
            
            $("body").append(container);
        }
        
        /* Widgets */
        var widgets = {};
        $("[data-widget]").each(function () {
            var widget_id = $(this).attr("id");
            var widget = danta.ui._make_widget(widget_id);
            
            if(widget.get_param("autorender") === "yes") {
                widget.render();
            }
            
            widget.id = widget_id;
            widgets[widget_id] = widget;
        });
        
        return { widgets: widgets };
    }
}
danta.ui.behavior = {
    Progressable: function (o, params) {
        if($(".progress", o.element).length <= 0) {
            o.element.addClass("behavior_Progressable");
            
            o.start_progress = function () { $(".progress", o.element).show(); }
            o.stop_progress  = function () { $(".progress", o.element).hide(); }
            
            var progress_bar = $('<div class="progress progress-striped active"><div class="progress-bar" role="progressbar" aria-valuenow="50" aria-valuemin="0" aria-valuemax="100"></div></div>');
            o.element.prepend(progress_bar);
        }
    },
    
    Typeable: function (o, params) {
        /*
        altGraphKey: false
        altKey: false
        charCode: 0
        ctrlKey: false
        keyCode: 8
        metaKey: false
        shiftKey: false
        which: 8               
        */
        
        var typeable = o._behaviors.Typeable(o);
        
        typeable.collection.addClass("behavior_Typeable");
        
        if(params.delay && params.action) {
            typeable.collection.keydown(_.debounce(params.action, params.delay));
        }
    },
    
    Clickable: function (o, params) {
        var clickable = o._behaviors.Clickable(o);
        
        clickable.collection.addClass("behavior_Clickable");
        
        clickable.collection.click(function () {
            params.action($(this));
        });
    },
    
    Selectable: function (o, params) {
        var selectable = o._behaviors.Selectable(o);
        var collection = selectable.collection;
        var css = {
            selectable: "behavior_Selectable",
            selected: "behavior_Selectable_selected"
        };

        collection.addClass(css.selectable);

        if(params.multiple) {}
        else { /* single select */
            collection.click(function () {
                collection.removeClass(css.selected);
                $(this).addClass(css.selected);

                selectable.action(params);
            });
        }
    }
}
